import { createMuiTheme } from 'material-ui/core/styles';

export default createMuiTheme({
  palette: {
    primary: '#0066ff',
    secondary: '#0066ff'
  },
  overrides: {
    MuiButton: {
      root: {
        color: 'white',
        '&:hover': {
          backgroundColor: '0066ff'
        }
      }
    }
  }
});
